Templates.template:
new sap.ui.vk.ContainerContent(
	"${sId}", // string
	{
		icon: "${icon}", // string
		title: "${title}", // string
		content: ${content} // sap.ui.core.Control
	}
)

new sap.ui.vk.FlexibleControl(
	"${sId}", // string
	{
		width: ${width}, // sap.ui.core.CSSSize
		height: ${height}, // sap.ui.core.CSSSize
		layout: ${"Stacked"}, // string
		enabled: ${bEnabled}, // boolean
		content: [${content}] // sap.ui.core.Control[]
	}
)

new sap.ui.vk.FlexibleControlLayoutData(
	"${sId}", // string
	{
		size: ${"auto"}, // sap.ui.core.CSSSize
		minSize: ${"0px"}, // sap.ui.core.CSSSize
		marginTop: ${"0px"}, // sap.ui.core.CSSSize
		marginBottom: ${"0px"} // sap.ui.core.CSSSize
	}
)

new sap.ui.vk.GraphicsCore(
	{
		totalMemory: ${totalMemory}, // int
		logElementId: "${logElementId}", // string
		statusElementId: "${statusElementId}" // string
	},
	"${webGLContextAttributes}" // object
)

new sap.ui.vk.LegendItem(
	"${sId}", // string
	{
		color: ${color}, // sap.ui.core.CSSColor
		semanticSpotType: ${semanticSpotType} // sap.ui.vbm.SemanticType
	}
)

new sap.ui.vk.ListPanelStack(
	"${sId}", // string
	{
		width: ${"100%"}, // sap.ui.core.CSSSize
		expanded: ${bExpanded}, // boolean
		expandAnimation: ${bExpandAnimation}, // boolean
		collapsible: ${bCollapsible}, // boolean
		content: [${content}] // sap.ui.vk.ListPanel[]
	}
)

new sap.ui.vk.NativeViewport(
	"${sId}", // string
	{
		limitZoomOut: ${bLimitZoomOut}, // boolean
		resize: [function (oEvent) {}, this], // function|array
		move: [function (oEvent) {}, this] // function|array
	}
)

new sap.ui.vk.Overlay(
	"${sId}", // string
	{
		zoomOnResize: ${bZoomOnResize}, // boolean
		areas: [${areas}], // sap.ui.vk.OverlayArea[]
		target: ${target}, // (sap.ui.core.Control|string)
		click: [function (oEvent) {}, this], // function|array
		contextMenu: [function (oEvent) {}, this] // function|array
	}
)

new sap.ui.vk.Toolbar(
	"${sId}", // string
	{
		title: ${""}, // string
		viewer: ${viewer} // (sap.ui.vk.Viewer|string)
	}
)
